import React from 'react';
import { Link } from 'react-router-dom';
import './PaymentMethodSelection.css';

const PaymentMethodSelection = () => {
  return (
    <div className="payment-method-selection">
      <h2>Select a Payment Method</h2>
      <div className="payment-options">
        {/* Fawry Option */}
        <Link to="/fawry" className="payment-option">
          <button className="payment-btn">Fawry</button>
        </Link>

        {/* Digital Wallet Option */}
        <Link to="/digital-wallet" className="payment-option">
          <button className="payment-btn">Digital Wallet</button>
        </Link>

        {/* Credit Card Option */}
        <Link to="/paymentpage" className="payment-option">
          <button className="payment-btn">Credit Card</button>
        </Link>
      </div>
    </div>
  );
};

export default PaymentMethodSelection;
